import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import axios from 'axios';

class Tmdb extends Component {
    constructor (props) {
        super(props);

        this.state = {
            tmdb: null,
        };
        }

        async componentDidMount() {
            const tmdb = (await axios.get('https://api.themoviedb.org/3/account/{account_id}/watchlist/movies?api_key=d1e40fddb73df31e61693cbf7ef094aa&language=en-US&session_id=d38ef9ba5672c0c9660f9bdd47b123bf609c2a13'))
            .then((response) => {
                console.log(response);
            }, (error) => {
                console.log(error);
            });
        }
    }

    export default Tmdb;
